How to write mongoose query to combine data from two model's?<p>Technology: MongoDB, ExpressJS</p>
<p>I have 3 schema</p>
<ol>
<li>userSchema:</li>
</ol>
<pre><code>userSchema = {
  name: {type: String},
  password: {type: String},
  email: {type: String},
  friends: {type: [mongoose.Types.ObjectId]}
}
</code></pre>
<ol start="2">
<li>textPostSchema =</li>
</ol>
<pre><code>textPostSchema = {
   text: {type: String},
   postType: {type: String, default: &quot;textPost&quot;},
   userId: {type: mongoose.Types.ObjectId}
}
</code></pre>
<ol start="3">
<li>articalPostSchema:</li>
</ol>
<pre><code>articalPostSchema = {
  title: {type: String},
  content: {type: String}
  postType: {type: String, default: &quot;articalPost&quot;},
  userId: {type: mongoose.Types.ObjectId}
}
</code></pre>
<p>now I have one social media application in which I have to show these two post when user's friend post's a post, and include infinite scroll. Both <code>textPost</code> and <code>articalPost</code> should be send if  to frontend and only total 10 post should be sent at a time. How should I write a API for timeline?</p>
<p><strong>output</strong> should look like:</p>
<pre><code>{
  post: [
          {
           title: &quot;artical Post title&quot;, 
           content: &quot;artical post content&quot;, 
           postType: &quot;articalPost&quot;, 
           userId: &quot;60b9c9801a2a2547de643ccd&quot;
          },
          {
           text: &quot;text post &quot;, 
           postType: &quot;textPost&quot;, 
           userId: &quot;60b9c9801a2a2547de643ccd&quot;
          }, 
          ... 8 more
        ]
}
</code></pre>
<p><strong>UPDATE:</strong>
I got the solution:-
I created on more schema:</p>
<pre><code>timelineSchema = {
    postId: {
      type: mongoose.Types.ObjectId,
      required: true,
      ref: function () {
        switch (this.postCategoryType) {
          case 'articleposts':
            return 'ArticlePost';
          case 'textposts':
            return 'TextPost';
        }
      },
    },
    postCategoryType: {
      type: String,
      required: true,
    },
    userId: {
      type: mongoose.Types.ObjectId,
      required: true,
      ref: 'User',
    },
  },

</code></pre>
<p>and then I created one function to get only friends post:</p>
<pre><code>exports.getTimelinePosts = async (req, res) =&gt; {
  try {
    const timelinePosts = await TimelineModel.find({
      userId: { $in: [...req.user.friends, req.params.id] },
    })
      .skip((req.params.page - 1) * 10)
      .limit(10)
      .sort({ createdAt: -1 })
      .populate('postId');
    return res.status(200).json({ status: 'success', data: timelinePosts });
  } catch (error) {
    return res.status(500).json(error);
  }
};
</code></pre>

