Timing issue using `connect-mongo` and Mongoose with MongoDB Atlas<p>I am using <a href="https://www.npmjs.com/package/connect-mongo" rel="nofollow noreferrer">connect-mongo</a> for my ExpressJS Session Store and <a href="https://www.npmjs.com/package/mongoose" rel="nofollow noreferrer">Mongoose</a> for my DB connection and am having, what I will call, a timing issue with it. Here is my code:</p>
<p><strong><code>dbservice.js</code></strong></p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');
const debug = require('debug')('app:core:db:service');
const chalk = require('chalk');
const config = require('config');

const mongoDbUrl = config.mongodb_url;

const mongoDbOptions = {
  useUnifiedTopology: true,
  useNewUrlParser: true,
  useCreateIndex: true,
  useFindAndModify: false,
};
(async () =&gt; {
  try {
    await mongoose.connect(mongoDbUrl, mongoDbOptions);
    debug(`Connected to ${chalk.green('MongoDB')}`);
  } catch (err) {
    debug(`${chalk.green('MongoDB')} connection ${chalk.red(`error`)}: ${err}`);
  }
})();
const db = mongoose.connection;
db.on('error', (err) =&gt; {
  debug(`${chalk.green('MongoDB')} connection ${chalk.red(`error`)}: ${err}`);
});
// For nodemon restarts
process.once('SIGUSR2', () =&gt; {
  const msg = 'Nodemon Restart';
  db.close()
    .then(() =&gt; {
      debug(`${chalk.green('MongoDB')} connection ${chalk.red(`closed`)}: ${msg}`);
      process.kill(process.pid, 'SIGUSR2');
    })
    .catch((err) =&gt; {
      debug(err);
    });
});
const dbClient = db.getClient();

module.exports = dbClient;
</code></pre>
<p><strong><code>app.js</code></strong></p>
<pre><code>const dbClient = require('dbService');

// Using Express Session with Google Cloud Datastore to securly store session/cookie information
app.use(
  session({
    // Using MongoDB as session store
    store: MongoStore.create({
      client: dbClient, // Use Mongoose for DB Conection
      ttl: 1800000, // Ages session out at 30 minutes
      autoRemove: 'native', // Uses MongoDB's native Time to Live (TTL) to expire and remove records
      },
    }),
  }),
);
</code></pre>
<p>This code works great when using a local, on-network instance of MongoDB because there is such a small delay in connecting to MongoDB that it works. However, when using MongoDB Atlas, there is a one to two second delay in connection. So, I suspect (what I thought was brilliant) my line of code <code>const dbClient = db.getClient()</code> in <strong><code>dbservice.js</code></strong> is failing with <code>connect-mongo</code> throwing out error:</p>
<pre><code>(node:1148) UnhandledPromiseRejectionWarning: MongoError: MongoClient must be connected before calling MongoClient.prototype.db` because Mongoose is not connected.
</code></pre>
<p>As a novice, I have been struggling to try and solve this issue. I was trying to find a way to use <code>mongoose.connection.readyState</code> to wait until it returned a <code>1</code> for connected but have failed.</p>
<p>My question is this: Is there a better way for me to return <code>dbClient</code> with it properly waiting for Mongoose to connect to MongoDB? Any help is greatly appreciated.</p>

