How can I get a document in mongoose that have the current time in range of two Date values in a doc?<p>I am making an api to fetch an ongoing/next exam using mongoose, I have two values: startTime and endTime in the model, and I want to fetch the current exam that is ongoing:<br />
(PS: I used fastify)<br />
Model:</p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require(&quot;mongoose&quot;)
const { SchemaTypes } = require(&quot;mongoose&quot;)

const ExamsSchema = new mongoose.Schema({
  startTime: SchemaTypes.Date,
  endTime: SchemaTypes.Date,
  subject: SchemaTypes.String,
})

const Exams = mongoose.model(&quot;Exams&quot;, ExamsSchema)

module.exports = { Exams }
</code></pre>
<p>and I tried to do this but it returns &quot;none&quot; every time(I already have 2 test exams in the database, there's no problem with the db):
<a href="https://i.stack.imgur.com/1MS7b.png" rel="nofollow noreferrer">api response</a></p>
<pre class="lang-js prettyprint-override"><code>
fastify.get('/', async function (request, reply) {
  const exam = await Exams.findOne({
    $where: function () {
      const now = Date.now()
      return this.startTime.valueOf() &gt; now &gt; this.endTime.valueOf()
    }
  })

  if (exam) {
    reply.send({msg: &quot;ongoing&quot;, ...exam._doc})
  } else {
    const nextExam = await Exams.find({
      $where: () =&gt; {
        const now = Date.now()
        return (now &lt; this.startTime.valueOf())
      }
    })[0]
    if (nextExam) {
      reply.send({msg: &quot;next&quot;, ...nextExam})
    } else {
      reply.send({msg: &quot;none&quot;})
    }
  }
})
</code></pre>
<p>Two of the docs in the db:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;startTime&quot;: {
    &quot;$date&quot;: &quot;2021-07-21T04:00:00.000Z&quot;
  },
  &quot;endTime&quot;: {
    &quot;$date&quot;: &quot;2021-07-21T05:30:00.000Z&quot;
  },
  &quot;subject&quot;: &quot;SomeSubject&quot;
}
</code></pre>
<pre class="lang-json prettyprint-override"><code>{
  &quot;startTime&quot;: {
    &quot;$date&quot;: &quot;2021-07-21T03:00:00.000Z&quot;
  },
  &quot;endTime&quot;: {
    &quot;$date&quot;: &quot;2021-07-21T04:30:00.000Z&quot;
  },
  &quot;subject&quot;: &quot;SomeSubject&quot;
}
</code></pre>
<p>The current time is 2021-07-21T03:35:00.000Z</p>

